import React from 'react';

const Work3 = () => {
    return (
        <div id='work3' className='tc dib br1 pa3 ma2 bw2 shadow-5 w-75'>
            <p>January '16 - May '16 || 6 months</p>
            <hr></hr>
            <h3>Scientific Consultant</h3>
            <p>I worked on a number of research projects in aid to Prof KH Myburgh.</p>
            <p>This included managing and coordinating studies on sports supplements in collaboration with the South African Institute for Drug Free Sport, conducting physical performance tests on athletes as well as helping and mentoring new postgraduate students with their research.</p>
            <hr></hr>
            <p>Stellenbosch University</p>
        </div>
    );
}

export default Work3;
